import React, { PureComponent } from "react";
import PropTypes from "prop-types";
import {Link} from 'react-router-dom';
import "./Menu.css"
export default class Menu extends PureComponent {

  
  render() {
    return (
	  <div className='component-menu'>
		  <div style={{float: "left", padding: "2vh"}}>
			<Link to={{pathname:'/'}}  style={{padding: "3vh", color: "white", textDecoration: "none"}}>WCIW</Link>
		  </div>
		  <div style={{color: "white", float: "right", padding: "2vh"}}>
			<Link to={{pathname:'/preference'}} style={{padding: "3vh", color: "white", textDecoration: "none"}}>Preferences</Link>
			<Link to={{pathname:'/login'}} style={{padding: "3vh", color: "white", textDecoration: "none"}}>Login</Link>
			<Link className='sign-up'
			      to={{pathname:'/signup'}} 
			      style={{ color: "white", 
				           textDecoration: "none", 
						   border: "1px solid #bbb",
						   padding: "5px",
						   borderRadius : "10px",
						   boxSizing: 'border-box'}}> Sign Up </Link>
		  </div>
	  </div>
    );
  }
}
